INSERT INTO `wp_posts` VALUES (1,1,'2021-10-15 15:17:39','2021-10-15 18:17:39','<!-- wp:paragraph -->\n<p>Boas-vindas ao WordPress. Esse é o seu primeiro post. Edite-o ou exclua-o, e então comece a escrever!</p>\n<!-- /wp:paragraph -->','Olá, mundo!','','publish','open','open','','ola-mundo','','','2021-10-15 15:17:39','2021-10-15 18:17:39','',0,'http://localhost/?p=1',0,'post','',1),(2,1,'2021-10-15 15:17:39','2021-10-15 18:17:39','','Meus Seguros','','publish','closed','open','','pagina-exemplo','','','2021-11-03 16:36:24','2021-11-03 19:36:24','',0,'http://localhost/?page_id=2',0,'page','',0),(3,1,'2021-10-15 15:17:39','2021-10-15 18:17:39','<!-- wp:heading --><h2>Quem somos</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">Texto sugerido: </strong>O endereço do nosso site é: http://localhost.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Comentários</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">Texto sugerido: </strong>Quando os visitantes deixam comentários no site, coletamos os dados mostrados no formulário de comentários, além do endereço de IP e de dados do navegador do visitante, para auxiliar na detecção de spam.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>Uma sequência anonimizada de caracteres criada a partir do seu e-mail (também chamada de hash) poderá ser enviada para o Gravatar para verificar se você usa o serviço. A política de privacidade do Gravatar está disponível aqui: https://automattic.com/privacy/. Depois da aprovação do seu comentário, a foto do seu perfil fica visível publicamente junto de seu comentário.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Mídia</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">Texto sugerido: </strong>Se você envia imagens para o site, evite enviar as que contenham dados de localização incorporados (EXIF GPS). Visitantes podem baixar estas imagens do site e extrair delas seus dados de localização.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Cookies</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">Texto sugerido: </strong>Ao deixar um comentário no site, você poderá optar por salvar seu nome, e-mail e site nos cookies. Isso visa seu conforto, assim você não precisará preencher seus  dados novamente quando fizer outro comentário. Estes cookies duram um ano.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>Se você tem uma conta e acessa este site, um cookie temporário será criado para determinar se seu navegador aceita cookies. Ele não contém nenhum dado pessoal e será descartado quando você fechar seu navegador.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>Quando você acessa sua conta no site, também criamos vários cookies para salvar os dados da sua conta e suas escolhas de exibição de tela. Cookies de login são mantidos por dois dias e cookies de opções de tela por um ano. Se você selecionar &quot;Lembrar-me&quot;, seu acesso será mantido por duas semanas. Se você se desconectar da sua conta, os cookies de login serão removidos.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>Se você editar ou publicar um artigo, um cookie adicional será salvo no seu navegador. Este cookie não inclui nenhum dado pessoal e simplesmente indica o ID do post referente ao artigo que você acabou de editar. Ele expira depois de 1 dia.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Mídia incorporada de outros sites</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">Texto sugerido: </strong>Artigos neste site podem incluir conteúdo incorporado como, por exemplo, vídeos, imagens, artigos, etc. Conteúdos incorporados de outros sites se comportam exatamente da mesma forma como se o visitante estivesse visitando o outro site.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>Estes sites podem coletar dados sobre você, usar cookies, incorporar rastreamento adicional de terceiros e monitorar sua interação com este conteúdo incorporado, incluindo sua interação com o conteúdo incorporado se você tem uma conta e está conectado com o site.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Com quem compartilhamos seus dados</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">Texto sugerido: </strong>Se você solicitar uma redefinição de senha, seu endereço de IP será incluído no e-mail de redefinição de senha.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Por quanto tempo mantemos os seus dados</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">Texto sugerido: </strong>Se você deixar um comentário, o comentário e os seus metadados são conservados indefinidamente. Fazemos isso para que seja possível reconhecer e aprovar automaticamente qualquer comentário posterior ao invés de retê-lo para moderação.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>Para usuários que se registram no nosso site (se houver), também guardamos as informações pessoais que fornecem no seu perfil de usuário. Todos os usuários podem ver, editar ou excluir suas informações pessoais a qualquer momento (só não é possível alterar o seu username). Os administradores de sites também podem ver e editar estas informações.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Quais os seus direitos sobre seus dados</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">Texto sugerido: </strong>Se você tiver uma conta neste site ou se tiver deixado comentários, pode solicitar um arquivo exportado dos dados pessoais que mantemos sobre você, inclusive quaisquer dados que nos tenha fornecido. Também pode solicitar que removamos qualquer dado pessoal que mantemos sobre você. Isto não inclui nenhuns dados que somos obrigados a manter para propósitos administrativos, legais ou de segurança.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Para onde enviamos seus dados</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">Texto sugerido: </strong>Comentários de visitantes podem ser marcados por um serviço automático de detecção de spam.</p><!-- /wp:paragraph -->','Política de privacidade','','draft','closed','open','','politica-de-privacidade','','','2021-10-15 15:17:39','2021-10-15 18:17:39','',0,'http://localhost/?page_id=3',0,'page','',0),(5,1,'2021-10-15 15:20:00','2021-10-15 18:20:00','','n1-seguros-login-min','','inherit','open','closed','','n1-seguros-login-min','','','2021-10-15 15:20:00','2021-10-15 18:20:00','',2,'http://localhost/wp-content/uploads/2021/10/n1-seguros-login-min-1.png',0,'attachment','image/png',0),(6,1,'2021-10-15 15:20:04','2021-10-15 18:20:04','','Acesse sua conta','','inherit','closed','closed','','2-revision-v1','','','2021-10-15 15:20:04','2021-10-15 18:20:04','',2,'http://localhost/?p=6',0,'revision','',0),(7,1,'2021-10-15 15:49:31','2021-10-15 18:49:31','','logo 1','','inherit','open','closed','','logo-1','','','2021-10-15 15:49:31','2021-10-15 18:49:31','',0,'http://localhost/wp-content/uploads/2021/10/logo.png',0,'attachment','image/png',0),(9,1,'2021-10-15 18:30:33','2021-10-15 21:30:33','','e-mail-login','','inherit','open','closed','','e-mail-login','','','2021-10-15 18:30:33','2021-10-15 21:30:33','',0,'http://localhost/wp-content/uploads/2021/10/e-mail-login.svg',0,'attachment','image/svg+xml',0),(10,1,'2021-10-15 18:58:01','2021-10-15 21:58:01','','cadeado-login','','inherit','open','closed','','cadeado-login','','','2021-10-15 18:58:01','2021-10-15 21:58:01','',0,'http://localhost/wp-content/uploads/2021/10/cadeado-login.svg',0,'attachment','image/svg+xml',0),(13,1,'2021-11-10 15:24:25','2021-10-18 19:51:16','','Canal de <strong>Atendimento</strong>','','publish','closed','closed','','meus-seguros','','','2021-11-10 15:24:25','2021-11-10 18:24:25','',0,'http://localhost/?p=13',3,'nav_menu_item','',0),(14,1,'2021-11-10 15:24:25','2021-10-18 19:51:16','','Atendimento de <strong>